import React, { useState, useEffect } from "react";
import WeekBarGraph from './WeekBarGraph';
import MonthBarGraph  from "./MonthBarGraph";
import ThirtyOneDaysMonthBarGraph from "./ThirtyOneDaysMonthBarGraph";
import TaskMeter from './TaskMeter';
import TimeSelect from './TimeSelect';
import YearLineChart from "./YearLineChart";
import CurrentWeekButton from "./CurrentWeekButton";



function Dashbaord(props) {

    // const [isShown, setIsShown] = useState(1);
    const [status, setStatus] = useState(0);

    function toggleButtons(value) {
        switch(status) {
            // case 0: return <div className="col-lg-8 col-md-7 col-sm-8"><div className="bargraphdiv"><WeekBarGraph /></div></div>
            case 1: return <div className="col-lg-8 col-md-7 col-sm-8"><div className="bargraphdiv"><MonthBarGraph numberOfDays = "31"/></div></div>
            case 2: return <div className="col-lg-8 col-md-7 col-sm-8"><div className="bargraphdiv"><MonthBarGraph numberOfDays = "28" /></div></div>
            case 3: return <div className="col-lg-8 col-md-7 col-sm-8"><div className="bargraphdiv"><MonthBarGraph numberOfDays = "31"/></div></div>
            case 4: return <div className="col-lg-8 col-md-7 col-sm-8"><div className="bargraphdiv"><MonthBarGraph numberOfDays = "30" /></div></div>
            case 5: return <div className="col-lg-8 col-md-7 col-sm-8"><div className="bargraphdiv"><MonthBarGraph numberOfDays = "31" /></div></div>
            case 6: return <div className="col-lg-8 col-md-7 col-sm-8"><div className="bargraphdiv"><MonthBarGraph numberOfDays = "30" /></div></div>
            case 7: return <div className="col-lg-8 col-md-7 col-sm-8"><div className="bargraphdiv"><MonthBarGraph numberOfDays = "31" /></div></div>
            case 8: return <div className="col-lg-8 col-md-7 col-sm-8"><div className="bargraphdiv"><MonthBarGraph numberOfDays = "31" /></div></div>
            case 9: return <div className="col-lg-8 col-md-7 col-sm-8"><div className="bargraphdiv"><MonthBarGraph numberOfDays = "30" /></div></div>
            case 10: return <div className="col-lg-8 col-md-7 col-sm-8"><div className="bargraphdiv"><MonthBarGraph numberOfDays = "31" /></div></div>
            case 11: return <div className="col-lg-8 col-md-7 col-sm-8"><div className="bargraphdiv"><MonthBarGraph numberOfDays = "30" /></div></div>
            case 12: return <div className="col-lg-8 col-md-7 col-sm-8"><div className="bargraphdiv"><MonthBarGraph numberOfDays = "31" /></div></div>
        }
    }

    function swap(value){
        // console.log(value);
        setStatus(value);
    }



    return (
        <div>
            <div className="row">

                {toggleButtons(status)}
                {/* { status==0 ? <div className="col-lg-8 col-md-7 col-sm-8"><div className="bargraphdiv"><WeekBarGraph /></div></div> 
                :  <div className="col-lg-8 col-md-7 col-sm-8"><div className="bargraphdiv"><YearLineChart /></div></div> } */}

                <div className="col-lg-4 col-md-4 col-sm-4"><div className="timeselect"><TimeSelect setStatus={swap} status={status}/></div></div>

            </div>

            <div className="row">

                <div className="col-lg-8 col-md-8 col-sm-8"><div className="taskmeterdiv" style={{fontSize: 21, textAlign: 'center', color: 'white', marginTop: '5vh', marginLeft: '5vh', }}>
                <TaskMeter label="Bugs fixed" value={25}/></div></div>
                {/* <div className="col-lg-4 col-md-4 col-sm-4"><CurrentWeekButton onClick={() => props.setStatus(0)}/></div> */}

                <div className="col-lg-4 col-md-4 col-sm-4"><button className="btn btn-sm generalbtn" onClick={() => setStatus(0)} >
                    Current Week</button></div>



            </div>


    </div>
  );
}

export default Dashbaord;
